export default function returnSearch(searchData, string) {
  let container = [];

  searchData.forEach(profile => {
    profile.forEach(e => {
      if (e.data.toString().toLowerCase().includes(string)) {
        container.push(profile);
      };
    });
  });

  return [...new Set(container)];
}
